import '../introduce/css/header.css';
import logo from '../../images/logo.png';

function HomeWrapPage(){
    return(
        <header className="HomeWrapPage-header">
            <div>
                <ul>
                    <li><img src={logo}/></li>
                    <li>이주의 공부법</li>
                    <li>플래너</li>
                    <li>커뮤니티</li>
                    <li>소개</li>
                    <span id="homeLogin">
                        <li>로그인</li>
                        <li>회원가입</li>
                    </span>
                </ul>
            </div>
        </header>
    );
}

export default HomeWrapPage;
